import React from 'react';

export function SearchField (){
    return (
        <div className="search">
            <form className='form'>
            <label>
             <input className="searchField" placeholder="Search for a movie, tv show, person......" >
            </input>
            <div className="searchButton">Search</div>
            </label>
            </form>

        </div>

    )
}
